import { Navbar, Nav, Container } from 'react-bootstrap';

function TopNavbar({setActivePage}, {token}) {
  return (
    <Navbar bg="dark" variant="dark" expand="lg" sticky="top">
      <Container>
        <Navbar.Brand onClick={() => setActivePage('fuse')} style={{ cursor: 'pointer' }}>PokeFusion</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link onClick={() => setActivePage('fuse')}>Fuse</Nav.Link>
            <Nav.Link onClick={() => setActivePage('myfusions')}>My Fusions</Nav.Link>
            <Nav.Link onClick={() => setActivePage('premium')}>Premium</Nav.Link>
            <Nav.Link onClick={token? () => setActivePage('logout') : () => setActivePage('login')}>Logout</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default TopNavbar;
